import { React, useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
const Provjera = () => {
  let { id } = useParams();
  const [data, setData] = useState([]);

  useEffect(async () => {
    axios
      .get(`http://localhost:5000/kategorije/provjere/${id}`)
      .then((res) => {
        let provjera = [res.data];
        let provjera1 = provjera[0].provjere.filter((p) => {
          return p._id.includes(id);
        });
        setData(provjera1);
        console.log("data provjera: ", data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div>
      <h1>Provjera</h1>
    </div>
  );
};

export default Provjera;
